import React from "react";

import { motion } from "framer";

const Header = () => {
  return (
    <motion.h1
      style={{ fontFamily: "Roboto" }}
      initial={{ x: "120vw" }}
      animate={{ x: 0 }}
      transition={{ duration: 2 }}
    >
      Hello
    </motion.h1>
  );
};

export default Header;
